script: |
  super -f text -I q836.spq | sort > q836.out

inputs:
  - name: q836.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE + 72 + + 22 * col1 NOT BETWEEN col1 - + ( + 33 - - col2 * + 89 ) AND col0 * - col1;
  - name: tab1

outputs:
  - name: q836.out
    data: |
      51	14	96
      85	5	59
      91	47	68
